import lgc from '../lgc.png';
import './Items.css'
function Items() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={lgc} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default Items;
